def genRules(html):

    DOM = ("var rules = '2';"
           "var document = {};"
           "function getRules(){return rules}"
           "document.createElement = function() {"
           "      return {"
           "              sheet: {"
           "                      insertRule: function(rule, i) {"
           "                              if (rules.length == 0) {"
           "                                      rules = rule;"
           "                              } else {"
           "                                      rules = rules + '#' + rule;"
           "                              }"
           "                      }"
           "              }"
           "      }"
           "};"
           "document.querySelectorAll = function() {"
           "      return {};"
           "};"
           "document.head = {};"
           "document.head.appendChild = function() {};"

           "var window = {};"
           "window.decodeURIComponent = decodeURIComponent;")
    js_list = re.findall('(\(function\([a-zA-Z]{2}.*?_\).*?\(document\);)', html)

    for item in js_list:
        DOM = DOM + item

    htmlPre = "<html><meta http-equiv='Content-Type' content='text/html; charset=utf-8' /><head></head><body>    <script type='text/javascript'>"
    js = htmlPre + DOM + " document.write(rules)</script></body></html>"

    with open("middle/middle.html", "w", encoding="utf-8") as f:
        f.write(js)
    chrome_options = webdriver.ChromeOptions()
    chrome_options.add_argument('--headless')
    browser = webdriver.Chrome(executable_path="chromedriver.exe",options=chrome_options)
    pathPre = os.path.dirname(os.path.abspath(__file__))
    browser.get("file://{}/middle/middle.html".format(pathPre))
    realText = browser.find_element_by_tag_name('body').text
    browser.quit()
    rules = []
    a = re.compile('hs_kw(\d+)_baike(\S\S)::before { content:"(.*?)" }').findall(realText)
    for item1, item2,item3 in a:
        rules.append(["hs_kw" + item1 + "_baike"+item2, item3])
    a = re.compile('hs_kw(\d+)_config(\S\S)::before { content:"(.*?)" }').findall(realText)
    for item1, item2,item3 in a:
        rules.append(["hs_kw" + item1 + "_config"+item2, item3])

    a = re.compile('hs_kw(\d+)_option(\S\S)::before { content:"(.*?)" }').findall(realText)
    for item1, item2,item3 in a:
        rules.append(["hs_kw" + item1 + "_option"+item2, item3])
